import React from 'react';
import ProfileIcon from '../images/profileIcon.svg';

function Header() {
  return (
    <div className="header">
      <button type="button">
        <img src={ ProfileIcon } alt="profileicon" />
      </button>
    </div>
  );
}

export default Header;
